// ServerInterface represents all server handlers.
type ServerInterface interface {
	// Sign in
	// (POST /auth/signin)
	SignIn(ctx echo.Context) error
	// Sign up
	// (POST /auth/signup)
	SignUp(ctx echo.Context) error
	// Get all categories
	// (GET /categories)
	GetCategories(ctx echo.Context) error
	// Create a new category
	// (POST /categories)
	CreateCategory(ctx echo.Context) error
	// Register new device token
	// (POST /devices)
	CreateDevice(ctx echo.Context) error
	// Get all objects
	// (GET /objects)
	GetObjects(ctx echo.Context) error
	// Create a new object
	// (POST /objects)
	CreateObject(ctx echo.Context) error
}

// ServerInterfaceWrapper converts echo contexts to parameters.
type ServerInterfaceWrapper struct {
	Handler ServerInterface
}

// SignIn converts echo context to params.
func (w *ServerInterfaceWrapper) SignIn(ctx echo.Context) error {
	var err error

	ctx.Set(ApiKeyAuthScopes, []string{})

	// Invoke the callback with all the unmarshaled arguments
	err = w.Handler.SignIn(ctx)
	return err
}

